import React from 'react';

const Comments = () => {
    return (
        <div className="comments">
            <div className="media g-mb-33 media-comment">
                <img className="user-avatar" src="/user.png" alt="User Avatar"/>
                <div className="comment-content">
                    <div className="comment-header">
                        <h5 className="comment-username">John Doe</h5>
                        <span className="comment-timestamp">5 days ago</span>
                    </div>
                    <p className="comment-text">Comment text goes here.</p>
                    <ul className="comment-actions">
                        <li className="comment-action">
                            <a href="#!"><i className="fa fa-thumbs-up"></i> 178</a>
                        </li>
                        <li className="comment-action">
                            <a href="#!"><i className="fa fa-thumbs-down"></i> 34</a>
                        </li>
                        <li className="comment-action ml-auto">
                            <a href="#!"><i className="fa fa-reply"></i> Reply</a>
                        </li>
                    </ul>
                </div>
            </div>
            {/* Add more comments here */}
        </div>
    );
};

export default Comments;
